import React from 'react';
import './App.css';
import UserSelect from './Components/userSelect'

function App() {
  return (
    <div className="App">
      <div className="header">
        <h1 className="header__text">CSB Course Module Lookup</h1>
      </div>
        <div className="moduleChooser">
          <UserSelect/>
        </div>
    </div>
  );
}

export default App;
